import Aluno from './Aluno'
import Personal from './Personal'

import Header from  './Header'
import Treino from './Treino'
import {
BrowserRouter as Router,
Route,Switch
} from 'react-router-dom'





const Home =() =>{
return <h1> Home </h1>
}



//const Generos =() => {
