 // }

function App() {

  return(
    <Router>
    <div>

    <Header/>
    <Switch>
      <Route path='/' exact component={Home} />
>     < Route path='/Aluno' exact component={Aluno} />
      < Route path='/Personal' exact component={Personal} />
      < Route path='/Treino' exact component={Treino} />
       </Switch>
      </div>
    </Router>
  )
}

export default App;
